import React, { useState, useEffect } from "react";
import { Link } from 'react-router-dom';
import Booking from '../components/Booking'; 
import "../css/global.css";
import imgSrc from '../images/2.png'; 
import imgSrc1 from '../images/3.jpg'; 
import Services from './Services';
import Contact from './contact';

function App1() {
  const [menuOpen, setMenuOpen] = useState(false);
  const [lightOpacity, setLightOpacity] = useState([0.4, 0.4, 0.4]);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  useEffect(() => {
    const handleClickOutside = (e) => {
      if (!e.target.closest('.nav-container')) {
        setMenuOpen(false);
      }
    };
    document.addEventListener('click', handleClickOutside);
    return () => document.removeEventListener('click', handleClickOutside);
  }, []);

  useEffect(() => {
    const animateLights = () => {
      setLightOpacity(prev => prev.map((opacity, index) => index === 0 ? 0.8 : 0.4));
    };
    animateLights();
    const interval = setInterval(animateLights, 3000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div>
      {/* Header */}
      <header>
        <div className="nav-container">
          <div className="logo">
            <div className="logo-circle">
              <div className="logo-inner-circle"></div>
            </div>
            Celtical
          </div>
          <ul className={`nav-links ${menuOpen ? "active" : ""}`}>
            <li><Link to="/" className="current">Home</Link></li>
            <li><a href="#">Service</a></li>
            <li><Link to="/bookings">Bookings</Link></li> {/* Booking Page Link */}
            <li><a href="#">Offers</a></li>
            <li><a href="#">Contact</a></li>
            <li><a href="#">Company</a></li>
          </ul>

          <Link to="/HomePage" className="user-icon">
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="currentColor">
              <path stroke="none" d="M0 0h24v24H0z" fill="none"/>
              <path d="M12 2a5 5 0 1 1 -5 5l.005 -.217a5 5 0 0 1 4.995 -4.783z" />
              <path d="M14 14a5 5 0 0 1 5 5v1a2 2 0 0 1 -2 2h-10a2 2 0 0 1 -2 -2v-1a5 5 0 0 1 5 -5h4z" />
            </svg>
            <span>Login / Register</span>
          </Link>

          <div className="menu-toggle" onClick={toggleMenu}>
            <span></span>
            <span></span>
            <span></span>
          </div>
        </div>
      </header>

      {/* Hero */}
      <section className="hero">
        <div className="bg-blue-gradient"></div>
        <div className="bg-light bg-light-1" style={{ opacity: lightOpacity[0] }}></div>
        <div className="bg-light bg-light-2" style={{ opacity: lightOpacity[1] }}></div>
        <div className="bg-light bg-light-3" style={{ opacity: lightOpacity[2] }}></div>
        <div className="hero-content">
          <div className="hero-text">
            <span className="hero-tag">Happy Monday</span>
            <h1>Design is in your molecular Wash.</h1>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse varius enim in eros elementum tristique Suspendisse varius but care of your car brands.</p>
            <Link to="/bookings" className="book-now-btn hero-book-now">Book Now</Link> {/* Book Now goes to booking */}
          </div>
          <img src={imgSrc} alt="Car Wash" className="hero-car" />
        </div>

      <Services />
       {/* Contact Section */}
      <Contact />
      </section> <br/>
      <aboutus></aboutus>
      {/* Features */}
      <section className="features">
        <div className="feature-text">
          <span className="feature-tag">Happy Night</span>
          <h2>Dry Your Grease smbl-late!</h2>
          <p>A clean car brings out that confidence great. Your car is like an extension of who you are. We wash your car with cutting edge technology...</p>
          <a href="#" className="book-now-btn">Contact</a>
        </div>
        <div className="feature-image-container">
          <div className="feature-image">
            <img src={imgSrc1} alt="Car Detail" />
          </div>
          <div className="feature-buttons">
            <button className="feature-button">
              <i>✉</i> Shivashanker7337@gmail.com
            </button>
            <div className="button-divider"></div>
            <button className="feature-button">
              <i>☎</i> 07867034729
            </button>
          </div>
        </div>
      </section>

      {/* Smart Control */}
      <section className="smart-control">
        <div className="smart-device-container">
          <img src="/api/placeholder/400/400" alt="Smart Control Device" className="smart-device-img" />
        </div>
        <div className="smart-control-content">
          <h2>Extra control go only</h2>
          <p>It's your natural way by design as Y-o-Y</p>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse varius enim in eros elementum tristique security method that importantly works!</p>
          <div>
            <a href="#" className="share-button">
              <i>↗</i> Share
            </a>
            <span>5</span>
          </div>
        </div>
      </section>

      {/* Footer */}
      <footer>
        <div className="footer-dots">
          <div className="footer-dot"></div>
          <div className="footer-dot active"></div>
          <div className="footer-dot"></div>
        </div>
      </footer>
    </div>
  );
}

export default App1;
